// src/App.js
import React, { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Login from "./Login";
import ProtectedRoute from "./ProtectedRoute";

// üì¢ Í≥µÏßÄÏÇ¨Ìï≠ Í¥ÄÎ†®
import NoticeList from "./notices/NoticeList";
import NoticeBoard from "./notices/NoticeBoard";
import NoticeSearch from "./notices/NoticeSearch";
import NoticeDetail from "./notices/NoticeDetail";

// üìÖ Ï∫òÎ¶∞Îçî/ÏÉÅÌÉú Í¥ÄÎ†®
import CalendarView from "./calendar/CalendarView";
import StatusBoard from "./calendar/StatusBoard";

// üîê Í¥ÄÎ¶¨Ïûê
import AdminPage from "./admin/AdminPage";

function App() {
  const [logged, setLogged] = useState(!!localStorage.getItem("token"));

  return (
    <BrowserRouter>
      <Routes>
        {/* Î°úÍ∑∏Ïù∏ ÌôîÎ©¥ */}
        <Route
          path="/"
          element={
            <Login
              onLogin={() => {
                setLogged(true);
                window.location.href = "/notices"; // Î°úÍ∑∏Ïù∏ ÏÑ±Í≥µ ÌõÑ Ïù¥Îèô
              }}
            />
          }
        />

        {/* Í≥µÏßÄÏÇ¨Ìï≠ Îì±Î°ù/Î™©Î°ù */}
        <Route
          path="/notices"
          element={
            <ProtectedRoute>
              <NoticeList token={localStorage.getItem("token")} />
            </ProtectedRoute>
          }
        />

        {/* Í≥µÏßÄÏÇ¨Ìï≠ Ï†ÑÏ≤¥ Í≤åÏãúÌåê */}
        <Route
          path="/notice-board"
          element={
            <ProtectedRoute>
              <NoticeBoard token={localStorage.getItem("token")} />
            </ProtectedRoute>
          }
        />

        {/* Í≥µÏßÄÏÇ¨Ìï≠ Í≤ÄÏÉâ */}
        <Route
          path="/notice-search"
          element={
            <ProtectedRoute>
              <NoticeSearch token={localStorage.getItem("token")} />
            </ProtectedRoute>
          }
        />

        {/* Í≥µÏßÄÏÇ¨Ìï≠ ÏÉÅÏÑ∏ & Ï†ïÏ†ï Ï∂îÍ∞Ä */}
        <Route
          path="/notices/:id"
          element={
            <ProtectedRoute>
              <NoticeDetail token={localStorage.getItem("token")} />
            </ProtectedRoute>
          }
        />

        {/* Ï∫òÎ¶∞Îçî */}
        <Route
          path="/calendar"
          element={
            <ProtectedRoute>
              <CalendarView
                token={localStorage.getItem("token")}
                projectId={1}
              />
            </ProtectedRoute>
          }
        />

        {/* ÏÉÅÌÉúÏ∞Ω */}
        <Route
          path="/status-board"
          element={
            <ProtectedRoute>
              <StatusBoard token={localStorage.getItem("token")} />
            </ProtectedRoute>
          }
        />

        {/* Í¥ÄÎ¶¨Ïûê ÌéòÏù¥ÏßÄ */}
        <Route
          path="/admin-test"
          element={
            <ProtectedRoute>
              <AdminPage />
            </ProtectedRoute>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
